import './App.css';








function App() {
  const elment = document.querySelector('.hamburger');
      const elment1 = document.querySelector('.nav-list');

elment.addEventListener("click", ()=> {
  elment.classList.toggle('active');
  elment1.classList.toggle('active');
})

  return (

     <div className="container">
        <nav><a className="navbar-brand" href="#"> <i className="icon ion-md-planet"> </i></a>
          <ul className="nav-list">
            <li className="nav-item"><a className="nav-link" href="">home</a></li>
          <li className="nav-item"><a className="nav-link" href="">about</a></li>
            <li className="nav-item"><a className="nav-link" href="">videos</a></li>
            <li className="nav-item"><a className="nav-link" href="">competences</a></li>
            <li className="nav-item"><a className="nav-link" href="">contacts</a></li>
          </ul>
          <div className="hamburger">
            <div className="line"></div>
            <div className="line"></div>
            <div className="line"></div>
          </div>
        </nav>
      </div>



  );
}

export default App;
